export let fonts = function() {
 
 const base64 = {
  Roboto: '',
  RobotoCondensed: ''
 }

 let atRule = function(font) {
  if (font in base64) {
   return `@font-face {font-family:"${font}";src:url("data:application/x-font-ttf;base64,${base64[font]}") format("truetype");font-weight:normal;font-style:normal;}`;
  }
  else return `/*font ${font} unknown*/`;
 }

 let list = () => Object.keys(base64);

 return {
  atRule: atRule,
  list: list
 }
}();